import * as React from "react";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';

export default function ButtonAppBar() {
  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static" elevation={0}>
        <Toolbar sx={{ background: "white", borderBottom: "1px solid black"}}>
        <Typography sx={{fontFamily: "Space Grotesk", fontSize: 30, color: "#101828", fontWeight: "bold"}}>ASES</Typography>
          <Box
            sx={{
              display: "flex",
              flexDirection: "row",
              justifyContent: "space-between",
              width: "100%"
            }}>
            <Typography sx={{fontFamily: "Inter", fontSize: 16, color: "#667085", fontWeight: "bold" }}>Programs<KeyboardArrowDownIcon/></Typography>
            <Typography sx={{fontFamily: "Inter", fontSize: 16, color: "#667085", fontWeight: "bold"}}>About</Typography>
            <Typography sx={{fontFamily: "Inter", fontSize: 16, color: "#667085", fontWeight: "bold"}}>FAQ</Typography>
            <Typography sx={{fontFamily: "Inter", fontSize: 16, color: "#667085", fontWeight: "bold"}}>Team</Typography>
            <Typography sx={{fontFamily: "Inter", fontSize: 16, color: "#667085", fontWeight: "bold"}}>Sponsors</Typography>
          </Box>
          <Typography sx={{fontFamily: "Inter", fontSize: 16, color: "#667085", fontWeight: "bold"}}>Login/Sign Up</Typography>
        </Toolbar>
      </AppBar>
    </Box>
  );
}
